function MatchPoll(props) {
    const pollData = props.data

    const handleError = (event) => {
        event.target.src = "https://www.fotmob.com/_next/static/media/team_fallback.3ae01170.png";
    };

    return (
        <div className="flex flex-col gap-3 p-4 rounded-lg bg-white brd">
            <div className="font-medium text-base">Match Poll</div>
            <div className="flex justify-between">
                <div className="flex flex-col gap-2">
                    <img className="h-10 object-contain" onError={handleError} src={`https://images.fotmob.com/image_resources/logo/teamlogo/${pollData?.oddspoll?.HomeTeamId}.png`} alt="teamLogo" />
                </div>
            </div>
        </div>
    )
}

export default MatchPoll
